        // parsing and collecting nodes and edges from the python
        nodes = new vis.DataSet([{"color": "#377eb8", "id": "2012-2019_virkelighet_539", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet mange opplevde som h\u00f8ydepunktet var da de to m\u00e5tte reise\u003cbr\u003eseg fra stolene sine under seremonien for \u00e5 ta imot applausen fra\u003cbr\u003epublikum mens de holdt hverandre i hendene. EUs ledere hyllet det\u003cbr\u003eeuropeiske samarbeidet som selve avslutningen av kontinentets blodige\u003cbr\u003ekrigshistorie. EU-president Herman Van Rompuy, EU-kommisjonens\u003cbr\u003epresident Jos\u00e9 Manuel Barroso og EU-parlamentets president Martin\u003cbr\u003eSchulz mottok Nobels fredspris for 2012 p\u00e5 vegne av EU. - Her i Oslo\u003cbr\u003evil jeg gi en hyllest til alle de europeerne som dr\u00f8mte om et\u003cbr\u003ekontinent forsonet med seg selv, og alle dem som hver eneste dag gj\u00f8r\u003cbr\u003edenne dr\u00f8mmen til \u003cb\u003evirkelighet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_virkelighet_539\u003cbr\u003etype: usage\u003c/p\u003e", "x": 695.0658120585547, "y": 210.3837478516687}, {"color": "#377eb8", "id": "2012-2019_virkelighet_14295", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u2013 Det er \u003cb\u003evirkeligheten\u003c/b\u003e for mange folk. Det blir flott \u00e5\u003cbr\u003eha noen i Kongressen som forst\u00e5r hvor vanskelig det kan vaere, skriver\u003cbr\u003ebrukeren @llauralouisiana\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_virkelighet_14295\u003cbr\u003etype: usage\u003c/p\u003e", "x": 426.3782944700678, "y": 84.89031540478568}, {"color": "#377eb8", "id": "1980-1990_virkelighet_1025", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eVi kan p\u00e5 en m\u00e5te si at nasjonalregnskapssystemet er mer\u003cbr\u003eproduktivt enn \u003cb\u003evirkeligheten\u003c/b\u003e da alle innsats- og\u003cbr\u003esluttleveringskoeffisienter er mindre.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_virkelighet_1025\u003cbr\u003etype: usage\u003c/p\u003e", "x": -616.130577309426, "y": -328.94981584635985}, {"color": "#377eb8", "id": "2012-2019_virkelighet_7718", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen det kvinnelige blikket gir ofte andre perspektiver p\u00e5\u003cbr\u003elivet, det flirer av andre pinligheter og problematiserer\u003cbr\u003e\u003cb\u003evirkeligheten\u003c/b\u003e p\u00e5 en annen m\u00e5te enn mannens \u00f8yne gj\u00f8r.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_virkelighet_7718\u003cbr\u003etype: usage\u003c/p\u003e", "x": 148.00008192211612, "y": -654.9151349755402}, {"color": "#377eb8", "id": "2012-2019_virkelighet_186", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI \u003cb\u003evirkeligheten\u003c/b\u003e var dette penger som Rogaland\u003cbr\u003efylkeskommune skulle betalt. Dersom Stortinget f\u00f8lger r\u00e5dene til\u003cbr\u003eordf\u00f8rer Jostein Eiane, og\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_virkelighet_186\u003cbr\u003etype: usage\u003c/p\u003e", "x": -750.0, "y": 174.78140136078855}, {"color": "#377eb8", "id": "2012-2019_virkelighet_2550", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEtt av disse trekkene er alder, sier Gr\u00f8ntvedt. - Siden kvinner\u003cbr\u003ehar en h\u00f8yere grad av fertilitet rundt 20 - 22-\u00e5rsalderen, forventes\u003cbr\u003edet fra et evolusjonaert perspektiv at menn vil s\u00f8ke og ha preferanser\u003cbr\u003efor partnere rundt denne alderen, legger han til. -\u003cb\u003e\u003cbr\u003eVirkelighete\u003c/b\u003en er mer komplek\u003cspan style=\"color:#808080;\"\u003es\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_virkelighet_2550\u003cbr\u003etype: usage\u003c/p\u003e", "x": -104.28882425551978, "y": -338.1414159124744}, {"color": "#377eb8", "id": "1980-1990_virkelighet_732", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI \u003cb\u003evirkelighetens\u003c/b\u003e verden finner vi sjelden helt klare\u003cbr\u003eskillelinjer mellom institusjonelle og funksjonelle enheter.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_virkelighet_732\u003cbr\u003etype: usage\u003c/p\u003e", "x": 265.9712091623199, "y": -423.2928500305497}, {"color": "#377eb8", "id": "2012-2019_virkelighet_11464", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI \u003cb\u003evirkeligheten\u003c/b\u003e er all ekstremisme et sammensatt\u003cbr\u003efenomen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_virkelighet_11464\u003cbr\u003etype: usage\u003c/p\u003e", "x": -509.70107845296525, "y": 386.6924549071783}, {"color": "#377eb8", "id": "2012-2019_virkelighet_8517", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet er ingen beundring eller interesse for handlekraften og\u003cbr\u003emotet deres. De koster bare penger. Ord skaper\u003cbr\u003e\u003cb\u003evirkelighet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_virkelighet_8517\u003cbr\u003etype: usage\u003c/p\u003e", "x": 515.533030580191, "y": -378.51803458636226}, {"color": "#377eb8", "id": "1980-1990_virkelighet_1099", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDette har sammenheng med at det er forbundet med en viss\u003cbr\u003eusikkerhet \u00e5 vaere avhengig av offentlige overf\u00f8ringer for at driften\u003cbr\u003eskal svare seg, noe som vurderes annerledes av de som allerede er\u003cbr\u003ebosatt i omr\u00e5det. \u00d8ko-krisescenariet forutsetter at det skjer en\u003cbr\u003edesentralisering ogs\u00e5 av varehandelsm\u00f8nsteret fordi allokeringen av\u003cbr\u003eproduksjonsfaktorer til ekstraksjonsleddet f\u00f8rer til et mer\u003cbr\u003edesentralisert bosettingsm\u00f8nster. Samtidig som tallene for den\u003cbr\u003efylkesmessige fordelingen er blitt trukket inn, er ogs\u00e5 de regionale\u003cbr\u003eprosesser som ble fors\u00f8kt belyst teoretisk i kapittel 2 og praktisk i\u003cbr\u003ekapittel 4, mer direkte blitt trukket inn. De regionale m\u00f8nstre som er\u003cbr\u003eblitt beskrevet i dette punktet, er resultatet av prosessenes\u003cbr\u003ematerialisering i den konkrete\u003cb\u003e virkelighe\u003c/b\u003et\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_virkelighet_1099\u003cbr\u003etype: usage\u003c/p\u003e", "x": 480.4408206733754, "y": 399.1106422999274}, {"color": "#377eb8", "id": "2012-2019_virkelighet_13710", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eV\u00e5re museer er opptatt av Arktis \u2013 som en \u003cb\u003evirkelighet\u003c/b\u003e\u003cbr\u003eman lever i, som en konstruert forestilling, som samfunn og som land\u003cbr\u003esom er b\u00e5de felles og omstridt.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_virkelighet_13710\u003cbr\u003etype: usage\u003c/p\u003e", "x": -4.330034481868549, "y": 136.17599359070437}, {"color": "#377eb8", "id": "1980-1990_virkelighet_667", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eHaugs uttalelse innebaerer vel reelt at mulige midler i\u003cbr\u003eutlandet ville vaere uten betydning for forhandlingene mellom partene\u003cbr\u003efordi staten i tilfelle ville legge sin hand p\u00e5 slike midler.\u003cbr\u003eSp\u00f8rsm\u00e5let om avtalen av 19. september 1975 \u003cb\u003ei virkelighet\u003c/b\u003een\u003cbr\u003etrekker veksler p\u00e5 et usikkert X som representerer midler Reksten-\u003cbr\u003egruppen m\u00e5tte kunne mobilisere fra utlandet, st\u00e5r der og kan ikke\u003cbr\u003eklart besvare\u003cspan style=\"color:#808080;\"\u003es.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_virkelighet_667\u003cbr\u003etype: usage\u003c/p\u003e", "x": -241.8837099837209, "y": 455.826772494833}, {"color": "#377eb8", "id": "2012-2019_virkelighet_922", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI \u003cb\u003evirkeligheten\u003c/b\u003e hjelper det bare med full aerlighet og\u003cbr\u003etotal utestengelse av en sykkelleder som systematisk har holdt oss for\u003cbr\u003enarr\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_virkelighet_922\u003cbr\u003etype: usage\u003c/p\u003e", "x": 138.7224217275915, "y": 315.7674208793462}, {"color": "#377eb8", "id": "2012-2019_virkelighet_8585", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI \u003cb\u003evirkeligheten\u003c/b\u003e gj\u00f8r cellegiften henne fryktelig kvalm\u003cbr\u003eog f\u00f8rer til at hun kaster opp mye.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_virkelighet_8585\u003cbr\u003etype: usage\u003c/p\u003e", "x": 68.5680093932312, "y": 548.5464843705754}, {"color": "#377eb8", "id": "1980-1990_virkelighet_808", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\"Den emosjonelle og etiske kraft, bildets sannhet, ligger i\u003cbr\u003eselve det at et innhold er blitt form. Ikke i selve formen, ikke\u003cbr\u003ehvorvidt innholdet gjengir en \"\"korrekt\"\" sosi\u003cb\u003eal\u003cbr\u003evirkelig\u003c/b\u003eh\u003cspan style=\"color:#808080;\"\u003eet.\"\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_virkelighet_808\u003cbr\u003etype: usage\u003c/p\u003e", "x": -264.914826204852, "y": -56.12726445953226}, {"color": "#377eb8", "id": "1980-1990_virkelighet_163", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eModellen for mottak og utplassering av flyktninger har g\u00e5tt ut\u003cbr\u003ep\u00e5 at de skal utplasseres i boliger og skaffes arbeid etter et\u003cbr\u003ekortvarig opphold p\u00e5 et mottakssenter - helst ikke mer enn 6 mndr. I\u003cbr\u003e\u003cb\u003evirkeligheten\u003c/b\u003e har det vist seg at dette har vaert vanskelig \u00e5\u003cbr\u003egjennomf\u00f8re\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_virkelighet_163\u003cbr\u003etype: usage\u003c/p\u003e", "x": -523.2527476116052, "y": 73.16114522696802}, {"color": "#377eb8", "id": "1980-1990_virkelighet_144", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI de fleste tilfellene har en likevel st\u00f8ttet opp om\u003cbr\u003eansvarsgruppenes valg. Mange av gruppene har i \u003cb\u003evirkeligheten\u003c/b\u003e\u003cbr\u003etrengt en sterkere oppf\u00f8lging enn den prosjektet har maktet. Dette vil\u003cbr\u003esi at prosjektet ikke har fungert godt nok som veileder, fagkyndig og\u003cbr\u003eaktiv oppf\u00f8lger.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_virkelighet_144\u003cbr\u003etype: usage\u003c/p\u003e", "x": -400.7905768442017, "y": -302.42088861875453}, {"color": "#377eb8", "id": "1980-1990_virkelighet_1009", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSom vi har pekt p\u00e5 allerede tidligere, er det ikke\u003cbr\u003etilstrekkelig \u00e5 ha kunnskaper om teknologien i seg seiv for \u00e5 kunne ta\u003cbr\u003estilling til hvilke av disse oppfatninger som st\u00e5r\u003cbr\u003e\u003cb\u003evirkeligheten\u003c/b\u003e naermest\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_virkelighet_1009\u003cbr\u003etype: usage\u003c/p\u003e", "x": 310.70570948519753, "y": -197.9571854607267}, {"color": "#377eb8", "id": "1980-1990_virkelighet_1000", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSlik m\u00e5 det vaere n\u00e5r vi skulle lage et nordisk skjema uten \u00e5\u003cbr\u003egj\u00f8re vold p\u00e5 den historiske\u003cb\u003e virkelighe\u003c/b\u003et\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_virkelighet_1000\u003cbr\u003etype: usage\u003c/p\u003e", "x": 43.212810657984576, "y": -123.8361544834202}, {"color": "#377eb8", "id": "1980-1990_virkelighet_628", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEn annen svakhet i beregningene er at avdr\u00e5tten til husdyra er\u003cbr\u003euavhengig av hva slags f6r dyra f\u00e5r. Dersom en erstatter en del av\u003cbr\u003ekraftfdret med grovfdr i f.eks. melkeproduksjonen, vil i\u003cbr\u003e\u003cb\u003evirkeligheten\u003c/b\u003e melkeytelsen til kua som regel g\u00e5 ned.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_virkelighet_628\u003cbr\u003etype: usage\u003c/p\u003e", "x": -208.4
